import React, { Component } from 'react';
import './App.css';
import Home from './Home.js';
import Login from './Login.js';

function App(props) {
  const isLoggedIn = props.isLoggedIn;
  if(isLoggedIn) {
    return (
      <div className="App">
        <div className="App-header">
          <strong>ReadingAid</strong>
        </div>
        <Home />
      </div>
    );
  } else {
    return (
      <div className="App">
        <div className="App-header">
          <strong>ReadingAid</strong>
        </div>
        <Login />
      </div>
    );
  }
}

export default App;
